(689, '0x01', '0xb5066903756d5fc9c28b3aa2ad6db8b2316662c2', 'rodeogenius.eth', NULL, 'KEK PEPE BALLOON', 'Memes save the world!💚For the culture!🙏\n\nThis is FANART Nyan Balloon 🎨 Created 2023 by SASHA CHUDO 🐸 Respect & Big Thanks for Inspiration to ☆Chris☆ @PRguitarman🎈\n\nThis is burn token. You\'ll have the option to exchange your Kek Pepe Balloon for a new piece in next 48 hours. Then in next 2-3 days new Kek Balloon character will appear. After 24 hours the Kek character is sealed, and a new character will take its place in next 2-3 days. Please check @ChudoSasshha Twitter page above for more details.', 'https://nft-cdn.alchemy.com/eth-mainnet/1afe719ba35fa3202ef3335bf5d5e22a'),
